import {useEffect, useState} from "react";
import axios from "axios";
var swearjar = require('swearjar');

const Create = () => {
    const [plates, setPlates] = useState([])
    const [id,setId] = useState( )

    useEffect(() => {
        axios.get('http://localhost:8080/plates/search/findByRegistrationplateIgnoreCase?registrationplate='+id, {mode:  'no-cors'})
            .then(res=> {
                console.log(res.data._embedded.plates)
                setPlates(res.data._embedded.plates)
            })
            .catch(err => {
                console.log(err)
            })


    }, [id])

    var notAvail =false;
    var cost =1;
    var undefinedid = false;

    if (plates.length ===0){
        notAvail =false;
    }
    else {
        notAvail =true;
    }

    if (id === undefined){
        undefinedid = true;
    }
    else {
        cost = Math.round(10000/id.length)
    }
    var swear = swearjar.profane(id)


    if (undefinedid===true){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
            </div>)}
    else if (swear===true){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <p>Please refrain from profanity</p>
            </div>)}
    else if (swear===false && notAvail===true){
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <p>Plate not availible</p>
            </div>
        )}
    else {
        return(
            <div className="box">
                <h2>Create a new plate</h2>
                <br/>
                <input type="text" className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                <br/>
                <h3>Plate available </h3>
                <br/>
                <h3>Plate cost: Â£{cost}</h3>
                <br/>
                <form action="http://lab.alexcican.com/minimal_signup_form/about.html" method="get">
                    <h1>Sign up</h1><br/>
                    <span className="input"></span>
                    <input type="text" name="name" placeholder="Full name" title="Format: Xx[space]Xx (e.g. Alex Cican)"
                           autoFocus autoComplete="off" required pattern="^\w+\s\w+$"/>
                    <span className="input"></span>
                    <input type="email" name="email" placeholder="Email address" required/>
                    <span id="passwordMeter"></span>
                    <input type="password" name="password" id="password" placeholder="Password"
                           title="Password min 8 characters. At least one UPPERCASE and one lowercase letter" required
                           pattern="(?=^.{8,}$)(?=.*[a-z])(?=.*[A-Z])(?!.*\s).*$"/>

                    <button type="submit" value="Sign Up" title="Submit form" className="icon-arrow-right">
                        <span>Sign up</span></button>
                </form>

            </div>)}


}

export default Create
